import React, { useEffect, useState } from "react";

const Card = ({ card }) => {
console.log(card);
   
    return (
        <>
<div className="g1">

<h1>{card.data.Firstname}</h1>
<h1>{card.data.Lastname}</h1>
<h1>{card.data.email}</h1>
<h1>{card.data.Address}</h1>
<h1>{card.data._id}</h1>
<h1>{card.data.Subscription}</h1>

</div>

<div className="g2" >
 
 <div className="id-logo"></div>

</div>


        </>
    )
}
export default Card;
